    [],nt"num_tags": 3,nt"name": "sunkhaze-meadows-national-wildlife-refuge-annual-narrative-report-calendar-year-1996",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Sunkhaze
    Meadows NWR, Carlton Pond Waterfowl Production Area, Benton Unit, and Unity Unit
    outlines Refuge accomplishments during the 1996 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses the master plan, management planning, compliance
    with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, manpower programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, forests, grasslands, and
    fire management. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh birds and waterbirds, game mammals,
    and fisheries resources. The public uses of the Refuge described in this report
    include interpretive programs, hunting, fishing, wildlife observation, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about rehabilitation, major maintenance, and equipment replacement.
    Items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
